import React from "react";
import ActiveWeatherIcon from "./ActiveWeatherIcon";
import WeatherIcon from "./WeatherIcon";

const IconsContainer = props => (
  <>
    {props.apiIcon === "01d" ? (
      <ActiveWeatherIcon icon={<i class="fad fa-sun fa-5x" />} />
    ) : (
      <WeatherIcon icon={<i className="fal fa-sun fa-5x" />} />
    )}

    {props.apiIcon === "02d" ? (
      <ActiveWeatherIcon
        icon={<i className="fad fa-cloud-sun fa-5x fa-flip-horizontal" />}
      />
    ) : (
      <WeatherIcon
        icon={<i className="fal fa-cloud-sun fa-5x fa-flip-horizontal" />}
      />
    )}

    {props.apiIcon === "03d" ? (
      <ActiveWeatherIcon icon={<i class="fad fa-clouds fa-5x" />} />
    ) : (
      <ActiveWeatherIcon icon={<i class="fal fa-clouds fa-5x" />} />
    )}

    {props.description === "overcast clouds" ? (
      <ActiveWeatherIcon icon={<i className="fad fa-clouds fa-5x" />} />
    ) : (
      <WeatherIcon icon={<i className="fal fa-cloud fa-5x" />} />
    )}

    {props.condition.toLowerCase() === "rain" ? (
      <ActiveWeatherIcon icon={<i class="fad fa-cloud-showers fa-5x" />} />
    ) : null}

    {props.condition.toLowerCase() === "thunderstorm" ? (
      <ActiveWeatherIcon icon={<i class="fad fa-thunderstorm-moon fa-5x" />} />
    ) : null}

    {props.condition.toLowerCase() === "snow" ? (
      <ActiveWeatherIcon icon={<i class="fad fa-cloud-snow fa-5x" />} />
    ) : null}

    {props.condition.toLowerCase() === "mist" ? (
      <ActiveWeatherIcon icon={<i class="fad fa-fog fa-5x" />} />
    ) : null}
  </>
);

export default IconsContainer;
